import  React from'react';
import TextField from "@material-ui/core/TextField";
import jsPDF from 'jspdf';
import ReactDOMServer from 'react-dom/server';



import './App.css';


function App() {

  /* const calculations = () => {

    const [values,setValues]=useState({first:"",second:"",multiply:""})
